"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[6933],{16697:(t,e,n)=>{n.r(e),n.d(e,{default:()=>a,johnChapter1PL:()=>r});const r={chapter:1,title:"Jean 1",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Na pocz\u0105tku by\u0142o S\u0142owo, a ono S\u0142owo by\u0142o u Boga, a Bogiem by\u0142o ono S\u0142owo.",strong:[{text:"commencement",strong:"G746",start:3,end:15},{text:"Parole",strong:"G3056",start:25,end:31},{text:"Parole",strong:"G3056",start:39,end:45},{text:"avec",strong:"G1848",start:52,end:56},{text:"Dieu",strong:"G2316",start:57,end:61},{text:"Parole",strong:"G3056",start:69,end:75},{text:"Dieu",strong:"G2316",start:82,end:86}]},{number:2,text:"To by\u0142o na pocz\u0105tku u Boga.",strong:[{text:"commencement",strong:"G746",start:14,end:26},{text:"avec",strong:"G1848",start:27,end:31},{text:"Dieu",strong:"G2316",start:32,end:36}]},{number:3,text:"Wszystkie rzeczy przez nie si\u0119 sta\u0142y, a bez niego nic si\u0119 nie sta\u0142o, co si\u0119 sta\u0142o.",strong:[{text:"rien",strong:"G3762",start:42,end:46}]},{number:4,text:"W nim by\u0142o \u017cywot, a \u017cywot by\u0142 \u015bwiat\u0142o\u015bci\u0105 ludzk\u0105.",strong:[]},{number:5,text:"A ona \u015bwiat\u0142o\u015b\u0107 w ciemno\u015bciach \u015bwieci, ale ciemno\u015bci jej nie ogarn\u0119\u0142y.",strong:[{text:"dans",strong:"H6887",start:16,end:20}]},{number:6,text:"By\u0142 cz\u0142owiek pos\u0142any od Boga, kt\xf3remu imi\u0119 by\u0142o Jan.",strong:[{text:"homme",strong:"G444",start:12,end:17},{text:"Dieu",strong:"G2316",start:28,end:32},{text:"Jean",strong:"G2491",start:48,end:52}]},{number:7,text:"Ten przyszed\u0142 na \u015bwiadectwo, aby \u015bwiadczy\u0142 o onej \u015bwiat\u0142o\u015bci, \u017ceby wszyscy uwierzyli przez niego.",strong:[{text:"rendre",strong:"G1743",start:36,end:42}]},{number:8,text:"Nie by\u0142 on on\u0105 \u015bwiat\u0142o\u015bci\u0105, ale by\u0142 pos\u0142any, aby \u015bwiadczy\u0142 o onej \u015bwiat\u0142o\u015bci.",strong:[{text:"rendre",strong:"G1743",start:46,end:52}]},{number:9,text:"By\u0142a ona \u015bwiat\u0142o\u015b\u0107 prawdziwa, kt\xf3ra o\u015bwieca ka\u017cdego cz\u0142owieka przychodz\u0105cego na \u015bwiat.",strong:[{text:"Cette",strong:"G3778",start:0,end:5},{text:"dans",strong:"H6887",start:57,end:61},{text:"monde",strong:"G2889",start:65,end:70},{text:"tout",strong:"G3956",start:80,end:84},{text:"homme",strong:"G444",start:85,end:90}]},{number:10,text:"Na \u015bwiecie by\u0142, a \u015bwiat przez niego si\u0119 sta\u0142, ale \u015bwiat go nie pozna\u0142.",strong:[{text:"dans",strong:"H6887",start:11,end:15},{text:"monde",strong:"G2889",start:19,end:24},{text:"monde",strong:"G2889",start:32,end:37},{text:"monde",strong:"G2889",start:65,end:70}]},{number:11,text:"Do swojej w\u0142asno\u015bci przyszed\u0142, ale swoi w\u0142asni go nie przyj\u0119li.",strong:[]},{number:12,text:"A ile ich go przyj\u0119\u0142o, da\u0142 im moc, aby si\u0119 stali synami Bo\u017cymi, tym, kt\xf3rzy wierz\u0105 w imi\u0119 jego;",strong:[{text:"devenir",strong:"G1096",start:92,end:99},{text:"Dieu",strong:"G2316",start:111,end:115}]},{number:13,text:"Kt\xf3rzy nie z krwi, ani z woli cia\u0142a, ani z woli m\u0119\u017ca, ale z Boga narodzeni s\u0105.",strong:[{text:"chair",strong:"G4561",start:55,end:60},{text:"homme",strong:"G444",start:84,end:89},{text:"Dieu",strong:"G2316",start:99,end:103}]},{number:14,text:"A S\u0142owo cia\u0142em si\u0119 sta\u0142o i mieszka\u0142o mi\u0119dzy nami, (i widzieli\u015bmy chwa\u0142\u0119 jego, chwa\u0142\u0119 jako jednorodzonego od Ojca,) pe\u0142ne \u0142aski i prawdy.",strong:[{text:"parole",strong:"G3056",start:6,end:12},{text:"chair",strong:"G4561",start:25,end:30},{text:"comme",strong:"G2531",start:137,end:142},{text:"Fils",strong:"G5207",start:156,end:160},{text:"unique",strong:"G1520",start:161,end:167}]},{number:15,text:"Jan \u015bwiadczy\u0142 o nim i wo\u0142a\u0142, m\xf3wi\u0105c: Ten by\u0142, o kt\xf3rym m\xf3wi\u0142em: Ten, co za mn\u0105 idzie, sta\u0142 si\u0119 przede mn\u0105, gdy\u017c by\u0142 pierwej ni\u017celi ja.",strong:[{text:"Jean",strong:"G2491",start:0,end:4}]},{number:16,text:"A z pe\u0142no\u015bci jego my wszyscy wzi\u0119li\u015bmy, i \u0142ask\u0119 za \u0142ask\u0119.",strong:[]},{number:17,text:"Albowiem zakon przez Moj\u017cesza jest dany, ale \u0142aska i prawda przez Jezusa Chrystusa si\u0119 sta\u0142a.",strong:[{text:"Christ",strong:"G5547",start:79,end:85}]},{number:18,text:"Boga nikt nigdy nie widzia\u0142; jednorodzony Syn, kt\xf3ry jest w \u0142onie Ojcowskim, ten go nam objawi\u0142.",strong:[{text:"Personne",strong:"G3762",start:0,end:8},{text:"Dieu",strong:"G2316",start:23,end:27},{text:"Fils",strong:"G5207",start:32,end:36},{text:"unique",strong:"G1520",start:37,end:43},{text:"dans",strong:"H6887",start:53,end:57}]},{number:19,text:"A to\u0107 jest \u015bwiadectwo Janowe, gdy \u017bydowie pos\u0142ali z Jeruzalemu kap\u0142any i Lewit\xf3w, aby go pytali: Ty\u015b ty kto?",strong:[{text:"Jean",strong:"G2491",start:23,end:27},{text:"demander",strong:"G154",start:115,end:123}]},{number:20,text:"I wyzna\u0142, a nie zaprza\u0142 si\u0119, i wyzna\u0142: \u017bem ja nie jest Chrystus.",strong:[{text:"Christ",strong:"G5547",start:64,end:70}]},{number:21,text:"I pytali go: C\xf3\u017c tedy? Eliaszem jeste\u015b? I rzek\u0142: Nie jestem. Prorokiem jeste\u015b? I odpowiedzia\u0142: Nie.",strong:[]},{number:22,text:"Tedy mu rzekli: Kt\xf3\u017ce\u015b jest? aby\u015bmy dali odpowied\u017a tym, kt\xf3rzy nas pos\u0142ali. Co powiadasz sam o sobie?",strong:[]},{number:23,text:"Rzek\u0142: Jam jest g\u0142os wo\u0142aj\u0105cego na puszczy: Prostujcie drog\u0119 Pa\u0144sk\u0105, jako powiedzia\u0142 Izajasz prorok.",strong:[{text:"dans",strong:"H6887",start:47,end:51},{text:"chemin",strong:"G3598",start:77,end:83},{text:"Seigneur",strong:"G2962",start:87,end:95},{text:"comme",strong:"G2531",start:97,end:102}]},{number:24,text:"A ci, kt\xf3rzy byli pos\u0142ani, byli z Faryzeusz\xf3w.",strong:[]},{number:25,text:"I pytali go, i rzekli mu: Przecz\u017ce tedy chrzcisz, je\u017ali\u015b ty nie jest Chrystusem, ani Eliaszem, ani prorokiem?",strong:[{text:"cette",strong:"G3778",start:22,end:27},{text:"Christ",strong:"G5547",start:83,end:89}]},{number:26,text:"Odpowiedzia\u0142 im Jan, m\xf3wi\u0105c: Ja chrzcz\u0119 wod\u0105, ale po\u015br\xf3d was stoi, kt\xf3rego wy nie znacie.",strong:[{text:"Jean",strong:"G2491",start:0,end:4}]},{number:27,text:"Onci jest, kt\xf3ry za mn\u0105 idzie, ale sta\u0142 si\u0119 przede mn\u0105, kt\xf3regom ja nie jest godzien rozwi\u0105za\u0107 rzemienia u trzewika jego.",strong:[]},{number:28,text:"To si\u0119 dzia\u0142o w Betabarze za Jordanem, gdzie Jan chrzci\u0142.",strong:[{text:"Jean",strong:"G2491",start:60,end:64}]},{number:29,text:"Nazajutrz ujrza\u0142 Jan Jezusa, id\u0105cego do niego, i rzek\u0142: Oto Baranek Bo\u017cy, kt\xf3ry g\u0142adzi grzech \u015bwiata.",strong:[{text:"Agneau",strong:"G721",start:60,end:66},{text:"Dieu",strong:"G2316",start:70,end:74},{text:"monde",strong:"G2889",start:96,end:101}]},{number:30,text:"Tenci jest, o kt\xf3rym ja powiedzia\u0142em: Za mn\u0105 idzie m\u0105\u017c, kt\xf3ry si\u0119 sta\u0142 przede mn\u0105; bo by\u0142 pierwej ni\u017ali ja.",strong:[{text:"homme",strong:"G444",start:46,end:51}]},{number:31,text:"A ja go nie zna\u0142em, ale \u017ceby by\u0142 objawion Izraelowi, dlatego przyszed\u0142em ja wod\u0105 chrzci\u0107.",strong:[{text:"baptiser",strong:"G907",start:88,end:96}]},{number:32,text:"I \u015bwiadczy\u0142 Jan, m\xf3wi\u0105c: \u017bem widzia\u0142 Ducha zst\u0119puj\u0105cego jako go\u0142\u0119bic\u0119 z nieba, i zosta\u0142 na nim.",strong:[{text:"Jean",strong:"G2491",start:0,end:4},{text:"Esprit",strong:"G4151",start:37,end:43},{text:"ciel",strong:"H8064",start:57,end:61},{text:"comme",strong:"G2531",start:62,end:67}]},{number:33,text:"A jam go nie zna\u0142; ale kt\xf3ry mi\u0119 pos\u0142a\u0142, abym chrzci\u0142 wod\u0105, ten mi rzek\u0142: Nad kt\xf3rymby\u015b ujrza\u0142 Ducha zst\u0119puj\u0105cego i zostaj\u0105cego nad nim, tenci jest, kt\xf3ry chrzci Duchem \u015awi\u0119tym.",strong:[{text:"baptiser",strong:"G907",start:52,end:60},{text:"Esprit",strong:"G4151",start:112,end:118},{text:"Esprit",strong:"G4151",start:176,end:182}]},{number:34,text:"A jam widzia\u0142 i \u015bwiadczy\u0142em, i\u017c ten jest Synem Bo\u017cym.",strong:[{text:"Fils",strong:"G5207",start:50,end:54},{text:"Dieu",strong:"G2316",start:58,end:62}]},{number:35,text:"Nazajutrz zasi\u0119 sta\u0142 Jan, i dwaj z uczni\xf3w jego.",strong:[{text:"Jean",strong:"G2491",start:14,end:18},{text:"avec",strong:"G1848",start:36,end:40},{text:"deux",strong:"G1417",start:41,end:45}]},{number:36,text:"A wejrzawszy na Jezusa, id\u0105cego, rzek\u0142: Oto Baranek Bo\u017cy.",strong:[{text:"Agneau",strong:"G721",start:53,end:59},{text:"Dieu",strong:"G2316",start:63,end:67}]},{number:37,text:"I s\u0142yszeli go dwaj uczniowie m\xf3wi\u0105cego, i szli za Jezusem.",strong:[{text:"deux",strong:"G1417",start:4,end:8}]},{number:38,text:"A obr\xf3ciwszy si\u0119 Jezus, i ujrzawszy, i\u017c za nim id\u0105, rzek\u0142 im: Czego szukacie? A oni mu rzekli: Rabbi! (kt\xf3re si\u0119 wyk\u0142ada: Mistrzu!) gdzie mieszkasz?",strong:[]},{number:39,text:"Rzek\u0142 im: P\xf3jd\u017acie a obaczcie. Przyszli i widzieli, gdzie mieszka\u0142, i u niego onego dnia zostali; a by\u0142o oko\u0142o godziny dziesi\u0105tej.",strong:[{text:"jour",strong:"H3117",start:109,end:113}]},{number:40,text:"By\u0142 Andrzej, brat Szymona Piotra, jeden z onych dw\xf3ch, kt\xf3rzy s\u0142yszeli o nim od Jana, i szli za nim.",strong:[{text:"deux",strong:"G1417",start:45,end:49},{text:"Jean",strong:"G2491",start:85,end:89}]},{number:41,text:"Ten najprz\xf3d znalaz\u0142 brata swego w\u0142asnego Szymona, i rzek\u0142 mu: Znale\u017ali\u015bmy Mesyjasza, (kt\xf3re si\u0119 wyk\u0142ada: Chrystusa.)",strong:[{text:"premier",strong:"G4413",start:28,end:35},{text:"Messie",strong:"G5547",start:89,end:95},{text:"Christ",strong:"G5547",start:113,end:119}]},{number:42,text:"I przywi\xf3d\u0142 go do Jezusa. A wejrzawszy na\u0144 Jezus, rzek\u0142: Ty\u015b jest Szymon, syn Jonasz\xf3w; ty b\u0119dziesz nazwany Cefas, (kt\xf3re si\u0119 wyk\u0142ada: Piotr.)",strong:[{text:"fils",strong:"G5207",start:73,end:77}]},{number:43,text:"Nazajutrz chcia\u0142 Jezus i\u015b\u0107 do Galilei; i znalaz\u0142 Filipa, i rzek\u0142 mu: P\xf3jd\u017a za mn\u0105.",strong:[{text:"rendre",strong:"G1743",start:30,end:36},{text:"Philippe",strong:"G5376",start:65,end:73}]},{number:44,text:"A by\u0142 Filip z Betsaidy, z miasta Andrzejowego i Piotrowego.",strong:[{text:"Philippe",strong:"G5376",start:0,end:8}]},{number:45,text:"Filip znalaz\u0142 Natanaela, i rzek\u0142 mu: Znale\u017ali\u015bmy tego, o kt\xf3rym pisa\u0142 Moj\u017cesz w zakonie i prorocy, Jezusa, syna J\xf3zefowego z Nazaretu.",strong:[{text:"Philippe",strong:"G5376",start:0,end:8},{text:"dans",strong:"H6887",start:87,end:91},{text:"fils",strong:"G5207",start:151,end:155}]},{number:46,text:"I rzek\u0142 mu Natanael: Z Nazaretu mo\u017ce by\u0107 co dobrego? Rzek\u0142 mu Filip: P\xf3jd\u017a a obacz.",strong:[{text:"Philippe",strong:"G5376",start:67,end:75}]},{number:47,text:"Ujrza\u0142 Jezus Natanaela, id\u0105cego ku niemu, i rzek\u0142 o nim: Oto prawdziwie Izraelczyk, w kt\xf3rym nie masz zdrady.",strong:[{text:"dans",strong:"H6887",start:78,end:82}]},{number:48,text:"Rzek\u0142 mu Natanael: Sk\u0105d\u017ce mi\u0119 znasz? Odpowiedzia\u0142 Jezus i rzek\u0142 mu: Pierwej ni\u017celi\u015b ci\u0119 Filip zawo\u0142a\u0142, gdy\u015b by\u0142 pod figowym drzewem, widzia\u0142em ci\u0119.",strong:[{text:"Philippe",strong:"G5376",start:69,end:77}]},{number:49,text:"Odpowiedzia\u0142 mu Natanael i rzek\u0142: Rabbi! ty jeste\u015b Syn Bo\u017cy, ty\u015b jest Kr\xf3l Izraelski.",strong:[{text:"Fils",strong:"G5207",start:47,end:51},{text:"Dieu",strong:"G2316",start:55,end:59}]},{number:50,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 mu: I\u017c cim powiedzia\u0142: Widzia\u0142em ci\u0119 pod figowym drzewem, wierzysz; wi\u0119ksze rzeczy nad te ujrzysz.",strong:[]},{number:51,text:"I rzek\u0142 mu: Zaprawd\u0119, zaprawd\u0119 powiadam wam: Od tego czasu ujrzycie niebo otworzone, i Anio\u0142y Bo\u017ce wst\u0119puj\u0105ce i zst\u0119puj\u0105ce na Syna cz\u0142owieczego.",strong:[{text:"ciel",strong:"H8064",start:62,end:66},{text:"Dieu",strong:"G2316",start:90,end:94},{text:"Fils",strong:"G5207",start:122,end:126},{text:"homme",strong:"G444",start:132,end:137}]}]},a=r}}]);
